function sanitize(o){

    //console.log(o)

    var p = o

    p = p.replace(new RegExp('#', 'g'), '')
    p = p.replace(new RegExp('\\.', 'g'), '')
    p = p.replace(new RegExp(' ', 'g'), '')
    p = p.replace(new RegExp('-', 'g'), '')

    return p

}

function u_sanitize(o){
    if(o === undefined){
        return 0
    } else {
        return o
    }
}

function hsl(h,s,l){
    return 'hsl(' + h + ', ' + s + '%, ' + l +'%)'
}

function rgb(r,g,b){
    return 'rgb(' + r + ', ' + g + ', ' + b +')'
}

function b(v){
    return 'rgb(' + v + ', ' + v + ', ' + v +')'
}

function translate(x, y) {
    return 'translate('+x+', '+y+') '
}

function scale(x, y) {
    return 'scale('+x+', '+y+')'
}

function to_coords(t){

    var substrings = (t.substring(t.indexOf('(') + 1, t.indexOf(')')).split(',') )

    return coords = [ parseFloat(substrings[0]), parseFloat(substrings[1]) ]

}

function create_margins(top, bottom, left, right){
    return {
        top: top,
        bottom: bottom,
        left: left,
        right: right,
        x: left + right,
        y: top + bottom
    }
}

